measurements.description:
Eighteen flowers and nine buds on three upright mature inflorescences, one flower and seven buds
	on one immature inflorescence, inflorescences ranging from 91-98cm;
	nicely displayed on a clean 154-cm tall by 93-cm wide plant grown in bark, 30-cm plastic pot;
	sepals and petals white, lightly bushed coerulea, lateral sepals midline flushed darker coerulea;
	lip white flushed coerulea, throat light chartreuse, veined darker blue-purple;	

	column white, anther cap purple;


    substance firm; texture bold crystalline.
